import React, { useState } from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button, Drawer, List, ListItem, ListItemText } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

const Header = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const closeMenu = () => {
    setMenuOpen(false);
  };

  const navItems = ['Inicio', 'Sobre', 'Produtos e Serviços', 'Produtos', 'Testemunhas', 'Blog'];

  return (
    <AppBar position="static" sx={{ backgroundColor: '#333' }}> {/* Ajustando o tom do background */}
      <Toolbar sx={{ justifyContent: 'space-between' }}>
        <IconButton
          color="inherit"
          aria-label="open drawer"
          edge="start"
          onClick={toggleMenu}
          sx={{ display: { md: 'none' } }}
        >
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" component="div">
          Logo
        </Typography>
        <Drawer
          anchor="left"
          open={menuOpen}
          onClose={closeMenu}
          sx={{ '& .MuiDrawer-paper': { width: '240px' } }}
        >
          <List>
            {navItems.map((item, index) => (
              <ListItem button key={index} onClick={closeMenu}>
                <ListItemText fontSize={2} primary={item} />
              </ListItem>
            ))}
          </List>
        </Drawer>
        <Toolbar sx={{ display: { xs: 'none', md: 'flex' } }}>
          {navItems.map((item, index) => (
            <Button key={index} color="inherit">
              {item}
            </Button>
          ))}
        </Toolbar>
        <Button color="inherit">Contato</Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
